DELIMITER $$
--
-- Procedimientos
--
DROP PROCEDURE IF EXISTS `sp_recalcular_reales`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_recalcular_reales` (IN `p_proyecto` INT, IN `p_codigo` CHAR(10))  BEGIN
  /* Recalcula cantidad_real y precio_unitario_real como promedio ponderado */
  UPDATE proyecto_costos pc
  LEFT JOIN (
    SELECT proyecto_id, codigo,
           SUM(cantidad_imputada) AS qty,
           SUM(monto_imputado)    AS amt
    FROM compras_imputaciones
    WHERE proyecto_id = p_proyecto AND codigo = p_codigo
    GROUP BY proyecto_id, codigo
  ) x ON x.proyecto_id = pc.proyecto_id AND x.codigo = pc.codigo
  SET pc.cantidad_real = IFNULL(x.qty, 0.00),
      pc.precio_unitario_real = CASE
         WHEN IFNULL(x.qty,0.00) > 0 THEN ROUND(x.amt / x.qty, 2)
         ELSE 0.00
      END
  WHERE pc.proyecto_id = p_proyecto AND pc.codigo = p_codigo;
END$$

DELIMITER ;

