DELIMITER $$
CREATE TRIGGER `trg_ccm_ad` AFTER DELETE ON `caja_chica_movimientos` FOR EACH ROW BEGIN
  IF OLD.estado <> 'ANULADO' THEN
    IF OLD.tipo IN ('INGRESO','TRASPASO_IN','AJUSTE') THEN
      UPDATE caja_chica SET total_ingresos = total_ingresos - OLD.monto WHERE id = OLD.caja_id;
    ELSEIF OLD.tipo IN ('EGRESO','TRASPASO_OUT') THEN
