DROP TRIGGER IF EXISTS `trg_cpit_to_costos_precios`;
DELIMITER $$
CREATE TRIGGER `trg_cpit_to_costos_precios` AFTER INSERT ON `compras_items` FOR EACH ROW BEGIN
  DECLARE v_prov INT; DECLARE v_fecha DATE; DECLARE v_moneda VARCHAR(8);
  SELECT proveedor_id, fecha_doc, moneda
    INTO v_prov, v_fecha, v_moneda
  FROM compras WHERE id = NEW.compra_id;

    codigo, proveedor_id, fecha_vigencia, moneda,
    costo_mat, costo_mo, costo_eq, costo_subc, gg_pct, utilidad_pct, observaciones
  ) VALUES (
    NEW.codigo, v_prov, v_fecha, v_moneda,
    CASE WHEN NEW.tipo_costo='MAT'  THEN NEW.precio_unitario ELSE 0 END,
    CASE WHEN NEW.tipo_costo='MO'   THEN NEW.precio_unitario ELSE 0 END,
    CASE WHEN NEW.tipo_costo='EQ'   THEN NEW.precio_unitario ELSE 0 END,
    CASE WHEN NEW.tipo_costo='SUBC' THEN NEW.precio_unitario ELSE 0 END,
    0.0000, 0.0000,
    CONCAT('Compra ID ', NEW.compra_id, ' / Línea ', NEW.linea)
  );
END
$$
DELIMITER ;

