--
-- Disparadores `proyecto_costos`
--
DROP TRIGGER IF EXISTS `proyecto_costos_bi`;
DELIMITER $$
CREATE TRIGGER `proyecto_costos_bi` BEFORE INSERT ON `proyecto_costos` FOR EACH ROW BEGIN
  -- Normaliza entradas
  SET NEW.familia = UPPER(IFNULL(NEW.familia, SUBSTRING(NEW.codigo,1,3)));
  SET NEW.grupo   = UPPER(IFNULL(NEW.grupo,   SUBSTRING(NEW.codigo,4,3)));
  SET NEW.item    = UPPER(IFNULL(NEW.item,    SUBSTRING(NEW.codigo,7,4)));
  -- Reconstruye codigo
  SET NEW.codigo  = UPPER(CONCAT(NEW.familia, NEW.grupo, NEW.item));
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `proyecto_costos_bu`;
DELIMITER $$
CREATE TRIGGER `proyecto_costos_bu` BEFORE UPDATE ON `proyecto_costos` FOR EACH ROW BEGIN
  IF NEW.codigo IS NOT NULL AND CHAR_LENGTH(NEW.codigo)=10
     AND (NEW.familia IS NULL OR NEW.grupo IS NULL OR NEW.item IS NULL) THEN
    SET NEW.familia = UPPER(SUBSTRING(NEW.codigo,1,3));
    SET NEW.grupo   = UPPER(SUBSTRING(NEW.codigo,4,3));
    SET NEW.item    = UPPER(SUBSTRING(NEW.codigo,7,4));
  END IF;
  SET NEW.codigo = UPPER(CONCAT(NEW.familia, NEW.grupo, NEW.item));
END
$$
DELIMITER ;

